import React from "react";
import "./style.css";

const Codes = () => {
  return (
    <>
      <div id="webpage">
        <div id="webpage_body">
          <h1 id="title" data-aos="fade-right">
            SAYAIB SARKAR
          </h1>
        </div>
      </div>
    </>
  );
};
export default Codes;
